(1, '0', '14', '1', 'মোঃ মামুনুর', 'রশীদ', 'Md. Abul Hossain', 'Misses. Shirina Hossain', '1995-12-22', '2021-01-22', 1749207035, 1749207035, 'unmarried', 'staff\\March2023\\3VbzjJnyoV8hmwcwzypH.png', 'fggggggggggggggggggggggggggggggggggggg', 'rrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrrr', 'B.SC(HONOURS), M.SC IN ZOOLOGY', 'tttttttttttttttttttttttttttttttttttttttttt', 'চট্টগ্রাম জেলাধীন কর্ণফুলী উপজেলার ঐতিহ্যবাহী কর্ণফুলী এ জে চৌধুরী কলেজটি একমাত্র উচ্চ শিক্ষা প্রতিষ্ঠান। এতদ্ঞ্চলে এই প্রতিষ্ঠানটির শিক্ষা এবং সাংস্কৃতিক কর্মকান্ডে উল্লেখযোগ্য অবদান রয়েছে। বর্তমান বিশ্ব তথ্য প্রযুক্তির জগতে অনেক দ্রূ এগিয়ে। ১৯৮২ সালে প্রতিষ্ঠিত এ প্রতিষ্ঠানটি তথ্য প্রযুক্তির জগত থেকে বিচ্ছিন্ন থাকতে পারে না। এই ধারণা থেকেই কলেজের ডাইনামিক ওয়েবসাইট তৈরী করার সিদ্ধান্ত নেয়া হয়েছে। এই প্রতিষ্ঠানটির কার্যক্রম এবং তথ্যাদি সম্পর্কে শিক্ষক, শিক্ষার্থী, অভিভাবক এবং যে কোন স্টেকহোল্ডারকে সর্বশেষ তথ্য দিয়ে আপডেট করার জন্য ওয়েবসাইটটি তৈরী করা হয়েছে। এতে ভর্তি কার্যক্রমসহ বিভিন্ন পরীক্ষার ফলাফল ও প্রোগ্রাম এর সংবাদগুলিও যুক্ত করা হয়েছে। আশা করি এ অনন্য উদ্যোগটি কলেজের সাফল্যের সাথে আরো একটি নতুন মাত্রা যুক্ত করবে।', '2345', '50k', 'probation', 'Morning', 'iiiiiiiiiiiiuuuuuuuuuuuuuuuuuuuuuuuuuu', 2, 3, 3, 4, 5, '6', '3498796', 'Asia', '2324', 'dania', NULL, NULL, NULL, NULL, 'principal@kajcc.edu.bd', '0', NULL, '$2y$10$r/ieLR3u4qjR1GjbOVZaQe/y2/.gvvoDlNfWhsla/toHxi0/XRe7m', '[{\"download_link\":\"staff\\\\December2022\\\\PKMVKtdus8lOoriEcwLG.xlsx\",\"original_name\":\"College Management System.xlsx\"}]', '[{\"download_link\":\"staff\\\\December2022\\\\3sZunGDnBC8WdcJqghGk.xlsx\",\"original_name\":\"College Management System.xlsx\"}]', '[{\"download_link\":\"staff\\\\December2022\\\\kiWxcXcjGs2FXXm6zagW.xlsx\",\"original_name\":\"College Management System.xlsx\"}]', '4', 321, '2022-11-10', 1, '2022-12-22 05:50:48', '2023-03-02 00:44:48', NULL, '4', 'মোঃ মামুনুর রশীদ', 222, 1),
(2, '01', '1', '12', 'মোহাম্মদ জসীম', 'উদ্দীন', 'Late Md. Abul Kashem', 'Sajeda Begum', '1965-10-30', '1989-11-02', 1819547794, 1919547794, NULL, 'staff\\March2023\\6JDXZDIDuAJseG0mxz4N.jpg', 'ROUDRA CHAYA, H/N:- Z-7, ROAD NO.-4, BLOCK #A. CHANDGAON R/A, CHATTAGRAM', 'VILL: AHALA, P/O- SAROATOLI, P/S- BOALKHALI, CHATTAGRAM', 'B.SC(HONOURS), M.SC IN ZOOLOGY', 'As a lecturer from 02-11-89 to 31-05-1999, as a assistanr professor from 01-06-1999 to 05-09-2002, as a vice principal from 05-09-2002 to 07-02-2015, as a principal from 08-02-2015 to till now', 'বাণিজ্যিক নগরী চট্টগ্রামের অতি সন্নিকটে নবগঠিত কর্ণফুলী উপজেলার অন্তর্গত কর্ণফুলী শাহ আমানত সেতুর ৩ কিলোমিটার দক্ষিণে মহাসড়কের পাশেই ৩.০৬ একর জায়গার উপর ১৯৮২ সালে প্রতিষ্ঠিত একমাত্র উচ্চ শিক্ষা প্রতিষ্ঠান কর্ণফুলী এ জে চৌধুরী কলেজ। এ প্রতিষ্ঠানে অধ্যয়নরত শিক্ষার্থীদের মেধা, মনন, সৃজনশীলতা, শৃঙ্খলা, অসাম্প্রদায়িক চেতনায় মানবিক মূল্যবোধ সম্পন্ন দেশপ্রেমিক নাগরিক গড়ে তোলায় এ প্রতিষ্ঠানের অংগীকার। শিক্ষার্থীদের শারিরীক ও মানসিক বিকাশের জন্য সাহিত্য, সাংস্কৃতিক, ক্রীড়া, রোভার স্কাউট ও রেড ক্রিসেন্টসহ নানামূখী কর্মসূচী এ কলেজে পালন করা হয়।তথ্য ও যোগাযোগ প্রযুক্তির যুগে বর্তমান বিশ্বের সাথে সংগতি রেখে আমাদের শিক্ষার্থীদের উচ্চ প্রযুক্তির যোগ্য নাগরিক হিসেবে গড়ে তোলার লক্ষ্যে তথ্য প্রযুক্তির উপর জোর দেয়া উচিত। এ লক্ষকে সামনে রেখেই এ কলেজের ছাত্র, শিক্ষক, অভিভাবক সকলেই কলেজের সকল তথ্য এবং কার্যক্রম সম্পর্কে জানতে পারে সেজন্যেই ডাইনামিক ওয়েবসাইট চালু করেছে। এতে সংশ্লিষ্ট সকলেই অতি সহজে প্রয়োজনীয় তথ্যে এক্সেস নিশ্চিত করতে পারবে এবং সামগ্রিক প্রশাসনে স্বচ্ছতা ও জবাবদিহিতা আনবে। এই ওয়েবসাইট খোলার ফলে এ কলেজের উন্নয়ন ও অগ্রগতির ইতিহাসে আরো একটি নতুন অধ্যায় যুক্ত হলো। আমি এই উপলক্ষে শিক্ষার্থী, শিক্ষক ও কর্মচারীদের কাছে শুভেচ্ছ জানাচ্ছি এবং এই প্রোগ্রামটির সফলতা কামনা করছি।', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'principal@kajcc.edu.bd', '0', NULL, NULL, '[]', '[]', '[]', '4', NULL, '1970-01-01', 1, '2023-03-01 05:29:19', '2023-03-02 00:40:58', NULL, '4', 'Mohammad Jashim Uddin', NULL, 8),
(3, '02', '2', '4', 'সমীর রঞ্জন', 'নাথ', 'Sudhir Ranjan Nath', 'Geeta Rani Debi', '1966-10-11', '1993-05-16', 1711903587, 1554346321, NULL, 'staff\\May2023\\DT8bGbGosCDLR7oYPb9v.jpg', 'Amanat Homes, 95 Sadarghat Post Office Lane, Sadarghat, Chattogram-4000.', 'Amanat Homes, 95 Sadarghat Post Office Lane, Sadarghat, Chattogram-4000.', 'M.COM(Accounting)', '01. Lecturer in Accounting 9.5 years Experience.rn02. Assistant Professor in Accounting -17 yearsrn03. Vice Principal - Since 05/12/2019 till now.', 'বীর প্রসবিনী কর্ণফুলী বিধৌত চট্টলার দক্ষিণ তীরে কর্ণফুলী উপজেলার একমাত্র উচ্চ শিক্ষা প্রতিষ্ঠান কর্ণফুলী এ জে চৌধুরী কলেজ। এ কলেজের একাডেমিক এবং প্রশাসনিক কার্যক্রমকে গতিশীল করার লক্ষ্যে তৈরী করা হয়েছে ডাইনামিক ওয়েবসাইট। তথ্য প্রযুক্তির এই যুগে শিক্ষার্থীদের আত্মবিকাশই আমাদের অংগীকার।শিক্ষার্থীদের শিক্ষাঙ্গন তথা ক্লাসমূখী করার জন্য নানাবিধ কর্মসূচী প্রচলন রয়েছে। এ সকল তথ্য সহজেই যাতে শিক্ষার্থীসহ সংশ্লিষ্ট সকলেই পেতে পারে সেই জন্যে তৈরী করা হয়েছে এই ডাইনামিক ওয়েবসাইট। কলেজের একাউন্টস, ভর্তি পদ্ধতি, পরীক্ষার ফলাফল সংরক্ষণ এবং শিক্ষার্থীদের অগ্রগতি প্রতিবেদন প্রস্তুত করা অনেক সহজ হবে। আমাদের সকলের সম্মিলিত প্রচেষ্টা ও অবদানে এই প্রতিষ্ঠানে ডাইনামিক ওয়েবসাই সংযুক্ত হয়ে এ কলেজের গৌরবদীপ্ত সাফল্যকে স্পর্শ করবে এটিই আমাদের অন্যতম প্রত্যাশা।', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'srnctg@gmail.com', '0', NULL, NULL, '[]', '[]', '[]', '4', NULL, '1970-01-01', 1, '2023-03-01 05:29:19', '2023-05-02 22:57:33', NULL, '9537', 'সমীর রঞ্জন নাথ', NULL, 8),
